        age: 34,
    };
    }
    harri=()=>{
        alerts("hiii");
    }
    render(){
        return(<>            <h1>
                <i>{this.state.name} sachin mahajan{this.state.age}</i></h1>
<button type="button" onClick={this.harri()}></button>
                </>

        )
    }
}      
export default Cl
